import React from "react";
import Hero from "../components/Hero";
import Container from "../components/Container";
import Background from "../images/summa.png";

function Home() {
  return (
    <div>
    <Hero backgroundImage={Background}>
      <p>hello</p>
    </Hero>
    <Container>
      <p>hi again</p>
    </Container>
    </div>
    )
};

export default Home;
